@voguebusiness released their Inclusivity Report from the A/W 2023 shows and, babe, it is not looking good. Although the past decade has shown an uptick in fat representation in media & marketing, the plus size clothing market appears to be shrinking. Which is surprising as plus sized people are only increasing year over year. 

It is exciting to see different kinds of bodies in spaces we were previously left out of. But I want to be able to purchase clothing for my body instead of having to put together looks with 94% less options. There are some fantastic independent brands in the plus space, but the resistance from large brands to go beyond size large feels glaring. What do you think? Can the industry overcome fatphobia to serve a still underrepresented market?

#fashionweek #autumnwinter2023 #voguebusiness #plussizefashion #inclusivefashion

easy outfit formula: 3 neutral pieces + 1 bold or bright piece! Or 75/25 split!

For me — wearing neutrals sometimes feels like a puzzle. How do I make things feel just a little more Lydia? If I feel like my look is just a little too muted I’ll put something loud in the mix. Adding these patterned, irridescent, velvet @tamara.malas pants makes everything more fun, and suits my wardrobe wheelhouse. 

If you are a person who has a lot of neutral items and feel a little shy about colour or pattern — this formula works for you too! Just reverse engineer! If something feels too bright or bold, ground it with neutrals. You might get more everyday mileage from the statement pieces in your wardrobe that you don’t reach for.

